import React from "react"
import Link from "next/link"

import "./layout.css";

class Layout extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div>
                <nav>
                    <img src="https://scontent-atl3-1.xx.fbcdn.net/v/t1.0-1/p320x320/38808567_10212032603999028_6786997738790715392_n.jpg?_nc_cat=104&_nc_ht=scontent-atl3-1.xx&oh=eb805d38c14c164ebd892049d0a29c2c&oe=5CE53AFF" />
                    <ul>
                        <Link href="/">
                            <a>Home</a>
                        </Link>
                        <Link href="/about">
                            <a>About</a>
                        </Link>
                    </ul>
                </nav>
                <main>
                    {this.props.children}
                </main>
            </div>
        );
    }
}

export default Layout;
